import React from "react";
import LandingSecond from "../Components/Pages/Home/LandingSecond";
import LandingThird from "../Components/Pages/Home/LandingThird";
import Header from "../Components/Shared/Header";

function Home() {
  return (
    <div>
      <Header />
      <LandingSecond />
      <LandingThird />
    </div>
  );
}

export default Home;
